export default class Sidebar extends React.component{
	constructor(props){
		super(props);
	}
	render(){
		return(
			<aside className="sidebar">
				{this.props.contacts.map(contact => <User user={contact} key={contact.user_id} />)}
			</aside>
		);
	}
} 

